KillPlayer:
      LDA     #PlayerState_Dying		  ; Mark player	as dead
      STA     PlayerState
      LDA     #0				  ; Clear some variables
      STA     PlayerHealth
      STA     CrouchJumpTimer
      STA     StarInvincibilityTimer
